import{_ as d,a as r,b as o,c as i}from"./chunks/debug_swd_port_gnd_vcc3_3.B5pBAYX7.js";import{_ as l,c as n,j as e,a as s,G as h,a8 as c,B as u,o as p}from"./chunks/framework.BDnHobkS.js";const R=JSON.parse('{"title":"Holybro Kakute F7 (Discontinued)","description":"","frontmatter":{},"headers":[],"relativePath":"ko/flight_controller/kakutef7.md","filePath":"ko/flight_controller/kakutef7.md"}'),m={name:"ko/flight_controller/kakutef7.md"};function f(b,t,k,g,S,_){const a=u("Badge");return p(),n("div",null,[t[0]||(t[0]=e("h1",{id:"holybro-kakute-f7-discontinued",tabindex:"-1"},[s("Holybro Kakute F7 (Discontinued) "),e("a",{class:"header-anchor",href:"#holybro-kakute-f7-discontinued","aria-label":'Permalink to "Holybro Kakute F7 (Discontinued)"'},"​")],-1)),h(a,{type:"info",text:"Discontinued"}),t[1]||(t[1]=c('<div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>PX4 does not manufacture this (or any) autopilot. Contact the <a href="https://holybro.com/" target="_blank" rel="noreferrer">manufacturer</a> for hardware support or compliance issues.</p></div><p>The <em>Kakute F7</em> from Holybro is a flight controller board designed for racers.</p><img src="'+d+'" width="400px" title="Kakute F7"><div class="info custom-block"><p class="custom-block-title">INFO</p><p>This flight controller is <a href="./../flight_controller/autopilot_manufacturer_supported.html">manufacturer supported</a>.</p></div><h2 id="주요-특징" tabindex="-1">주요 특징 <a class="header-anchor" href="#주요-특징" aria-label="Permalink to &quot;주요 특징&quot;">​</a></h2><ul><li>Main System-on-Chip: <a href="https://www.st.com/en/microcontrollers-microprocessors/stm32f745vg.html" target="_blank" rel="noreferrer">STM32F745VGT6</a><ul><li>CPU : 단정밀도 FPU의 216MHz ARM Cortex M7</li><li>RAM : 320KB SRAM</li><li>FLASH: 1 MB</li></ul></li><li>표준 레이서 폼 팩터 : 36x36mm, 표준 30.5mm 구멍 패턴</li><li>ICM20689 가속/자이로 (소프트 장착)</li><li>BMP280 기압계</li><li>microSD (로깅)</li><li>6개의 UART</li><li>I2C 버스 1 개</li><li>6 PWM 출력</li><li>내장 OSD 칩(SPI를 통한 AB7456)</li></ul><h2 id="구매처" tabindex="-1">구매처 <a class="header-anchor" href="#구매처" aria-label="Permalink to &quot;구매처&quot;">​</a></h2><p>The board can be bought from one of the following shops (for example):</p><ul><li><a href="https://www.getfpv.com/holybro-kakute-f7-tekko32-f3-metal-65a-4-in-1-esc-combo.html" target="_blank" rel="noreferrer">getfpv</a></li></ul><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>The <em>Kakute F7</em> is designed to work with the <em>Tekko32</em> 4-in-1 ESC and they can be bought in combination.</p></div><h2 id="커넥터-및-핀" tabindex="-1">커넥터 및 핀 <a class="header-anchor" href="#커넥터-및-핀" aria-label="Permalink to &quot;커넥터 및 핀&quot;">​</a></h2><p>This is the silkscreen for the <em>Kakute F7</em>, showing the top of the board:</p><p><img src="'+r+'" alt="Kakute F7 Silkscreen"></p><table tabindex="0"><thead><tr><th>핀</th><th>기능</th><th>기본값</th></tr></thead><tbody><tr><td>B+</td><td>배터리 양극 전압 (2S-6S)</td><td></td></tr><tr><td>5V</td><td>5V 출력 (최대 2A)</td><td></td></tr><tr><td>VO</td><td>비디오 송신기로 비디오 출력</td><td></td></tr><tr><td>VI</td><td>FPV 카메라의 비디오 입력</td><td></td></tr><tr><td>G 또는 GND</td><td>접지</td><td></td></tr><tr><td>SDA, SCL</td><td>I2C 연결(주변장치용)</td><td></td></tr><tr><td>R1, T1</td><td>UART1 RX 및 TX</td><td>TELEM1</td></tr><tr><td>R2, T2</td><td>UART2 RX 및 TX</td><td>TELEM2</td></tr><tr><td>R3, T3</td><td>UART3 RX 및 TX</td><td>NuttX 디버그 콘솔</td></tr><tr><td>R4, T4</td><td>UART4 RX 및 TX</td><td>GPS1</td></tr><tr><td>R6, T6</td><td>UART6 RX 및 TX</td><td>RC 포트</td></tr><tr><td>R7, T7</td><td>UART7 RX 및 TX(RX는 4-in-1 ESC와 함께 사용하기 위해 플러그에 있음)</td><td>DShot 텔레메트리</td></tr><tr><td>LED</td><td>WS2182 주소 지정이 가능한 LED 신호 와이어(테스트되지 않음)</td><td></td></tr><tr><td>Buz-</td><td>피에조 부저 네거티브 레그(부저 포지티브 레그를 5V 패드에 연결)</td><td></td></tr><tr><td>3V3</td><td>3.3V 출력(최대 200mA)</td><td></td></tr><tr><td>M1에서 M4</td><td>모터 신호 출력 (4-in-1 ESC에서 사용하기 위해 플러그에 위치)</td><td></td></tr><tr><td>M5, M6</td><td>추가 모터 신호 출력(보드 측면에 위치)</td><td></td></tr><tr><td>RSI</td><td>수신기에서 아날로그 RSSI(0-3.3V) 입력</td><td></td></tr><tr><td>Boot</td><td>부트로더 버튼</td><td></td></tr></tbody></table><p><a id="bootloader"></a></p><h2 id="부트로더-업데이트" tabindex="-1">부트로더 업데이트 <a class="header-anchor" href="#부트로더-업데이트" aria-label="Permalink to &quot;부트로더 업데이트&quot;">​</a></h2><p>The board comes pre-installed with <a href="https://github.com/betaflight/betaflight/wiki" target="_blank" rel="noreferrer">Betaflight</a>. Before PX4 firmware can be installed, the <em>PX4 bootloader</em> must be flashed. Download the <a href="https://github.com/PX4/PX4-user_guide/raw/main/assets/flight_controller/kakutef7/kakutef7_bl_0b3fbe2da0.hex" target="_blank" rel="noreferrer">kakutef7_bl.hex</a> bootloader binary and read <a href="./../advanced_config/bootloader_update_from_betaflight.html">this page</a> for flashing instructions.</p><h2 id="펌웨어-빌드" tabindex="-1">펌웨어 빌드 <a class="header-anchor" href="#펌웨어-빌드" aria-label="Permalink to &quot;펌웨어 빌드&quot;">​</a></h2><p>To <a href="./../dev_setup/building_px4.html">build PX4</a> for this target:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>make holybro_kakutef7_default</span></span></code></pre></div><h2 id="펌웨어-설치" tabindex="-1">펌웨어 설치 <a class="header-anchor" href="#펌웨어-설치" aria-label="Permalink to &quot;펌웨어 설치&quot;">​</a></h2><p>펌웨어는 일반적인 방법으로 설치할 수 있습니다.</p><ul><li>소스 빌드 및 업로드<div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>make holybro_kakutef7_default upload</span></span></code></pre></div></li><li><a href="./../config/firmware.html">Load the firmware</a> using <em>QGroundControl</em>. 미리 빌드된 펌웨어나 사용자 지정 펌웨어를 사용할 수 있습니다.</li></ul><h2 id="설정" tabindex="-1">설정 <a class="header-anchor" href="#설정" aria-label="Permalink to &quot;설정&quot;">​</a></h2><p>If you use a 4-in-1 ESC with Betaflight/Cleanflight motor assignment you can use the <a href="./../config/actuators.html">Actuator</a> configuration UI to set the motor ordering appropriately.</p><p>In addition to the <a href="./../config/">basic configuration</a>, the following parameters are important:</p><table tabindex="0"><thead><tr><th>매개변수</th><th>설정</th></tr></thead><tbody><tr><td><a href="./../advanced_config/parameter_reference.html#SYS_HAS_MAG">SYS_HAS_MAG</a></td><td>보드에 내부 자력계가 없기 때문에 비활성화하여야 합니다. 외부 자력계를 연결하여 활성화 할 수 있습니다.</td></tr></tbody></table><h2 id="시리얼-포트-매핑" tabindex="-1">시리얼 포트 매핑 <a class="header-anchor" href="#시리얼-포트-매핑" aria-label="Permalink to &quot;시리얼 포트 매핑&quot;">​</a></h2><table tabindex="0"><thead><tr><th>UART</th><th>장치</th><th>포트</th></tr></thead><tbody><tr><td>USART1</td><td>/dev/ttyS0</td><td>TELEM1</td></tr><tr><td>USART2</td><td>/dev/ttyS1</td><td>TELEM2</td></tr><tr><td>USART3</td><td>/dev/ttyS2</td><td>디버그 콘솔</td></tr><tr><td>UART4</td><td>/dev/ttyS3</td><td>GPS1</td></tr><tr><td>USART6</td><td>/dev/ttyS4</td><td>RC SBUS</td></tr><tr><td>UART7</td><td>/dev/ttyS5</td><td>ESC 텔레메트리(DShot)</td></tr></tbody></table><h2 id="디버그-포트" tabindex="-1">디버그 포트 <a class="header-anchor" href="#디버그-포트" aria-label="Permalink to &quot;디버그 포트&quot;">​</a></h2><h3 id="시스템-콘솔" tabindex="-1">시스템 콘솔 <a class="header-anchor" href="#시스템-콘솔" aria-label="Permalink to &quot;시스템 콘솔&quot;">​</a></h3><p>UART3 RX and TX are configured for use as the <a href="./../debug/system_console.html">System Console</a>.</p><h3 id="swd" tabindex="-1">SWD <a class="header-anchor" href="#swd" aria-label="Permalink to &quot;SWD&quot;">​</a></h3><p>The <a href="./../debug/swd_debug.html">SWD interface</a> (JTAG) pins are:</p><ul><li><code>SWCLK</code>: Test Point 2 (Pin 72 on the CPU)</li><li><code>SWDIO</code>: Test Point 3 (Pin 76 on CPU)</li><li><code>GND</code>: As marked on board</li><li><code>VDD_3V3</code>: As marked on board</li></ul><p>These are shown below.</p><p><img src="'+o+'" alt="SWD Pins on Kakute F7 - CLK SWO"> <img src="'+i+'" alt="SWD Pins on Kakute F7:  GND and VDD3V3"></p>',37))])}const y=l(m,[["render",f]]);export{R as __pageData,y as default};
